import { Navbar } from "react-bootstrap";

export default function Header() {
  return (
    <div>
      <Navbar>
        <Container>
          <Navbar.brand href='/'>
            <img
              src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQfhZhuP85TrZgXX77CHsZBomGsxhi8QLIA5g&usqp=CAU'
              height='30'
              width='30'
              alt='Logo'
            />
          </Navbar.brand>
        </Container>
      </Navbar>
    </div>
  );
}
